    await load()

    async function load() {
      const priceResponce = await fetch(
        PRICE_ENDPOINT,
        { method: "GET" }
      )
      const prices = await priceResponce.json()
      const ethPrice = prices.coins['coingecko:ethereum']
      const usdcPrice = prices.coins['coingecko:usd-coin']

      const body = {
        variables: {},
        query: "query ($owner: String) {\n  lprevenueDailies(first: 30, orderBy: updatedAt, orderDirection: desc) {\n    id\n    fee0\n    fee1\n    premiumSupply\n    premiumBorrow\n      createdAt\n      updatedAt\n      __typename\n}\n}",
      }

      fetch(
        PREDY_SUBGRAPH_ENDPOINT,
        { method: "POST", body: JSON.stringify(body) }
      ).then((res) => {
        res.json().then((data) => {
          const accumulatedFee0 = data.data.lprevenueDailies.reduce(
            (acc, revenue) => {
              return acc.plus(revenue.fee0)
            },
            BigNumber(0)
          )
          const accumulatedFee1 = data.data.lprevenueDailies.reduce(
            (acc, revenue) => {
              return acc.plus(revenue.fee1)
            },
            BigNumber(0)
          )
          const accumulatedPremiumBorrow =
            data.data.lprevenueDailies.reduce((acc, revenue) => {
              return acc.plus(revenue.premiumBorrow)
            }, BigNumber(0))

          const tradeFeeEth = accumulatedFee0.times(ethPrice.price).div("1e36").toNumber()
          const tradeFeeUsdc = accumulatedFee1.div("1e24").toNumber()

          console.log(tradeFeeEth, tradeFeeUsdc)


          updateText('trade-fee', '$' + convertNotionalToString(
            tradeFeeEth + tradeFeeUsdc
          ))

          updateText('premium', '$' + convertNotionalToString(
            accumulatedPremiumBorrow.div("1e24").toNumber()
          ))
        })
      })

      const bodyOI = {
        variables: {},
        query: "query ($owner: String) {\n  openInterestTotal(id: \"0x68a154fb3e8ff6e4da10ecd54def25d9149ddbde-2\") {\n    id\n longSquart\n longPerp\n shortSquart\n shortPerp\n}\n}",
      }

      fetch(
        PREDY_SUBGRAPH_ENDPOINT,
        { method: "POST", body: JSON.stringify(bodyOI) }
      ).then((res) => {
        res.json().then((data) => {
          const oi = data.data.openInterestTotal

          updateText('oi-short-perp', Number(BigInt(oi.shortPerp) / (10n ** 16n)) / 100)
          updateText('oi-long-perp', Number(BigInt(oi.longPerp) / (10n ** 16n)) / 100)

          updateText('oi-short-squart', convertNotionalToString(Number(BigInt(oi.shortSquart) * 2n / (10n ** 12n))))
          updateText('oi-long-squart', convertNotionalToString(Number(BigInt(oi.longSquart) * 2n / (10n ** 12n))))
        })
      })

      const bodyUniswap = {
        operationName: 'poolDayDatas',
        query: "query poolDayDatas($skip: Int!, $address: Bytes!) {\n  poolDayDatas(\n    first: 1\n    skip: $skip\n    where: {pool: $address}\n    orderBy: date\n    orderDirection: desc\n    subgraphError: allow\n  ) {\n    date\n    volumeUSD\n    tvlUSD\n    feesUSD\n    pool {\n      feeTier\n      __typename\n    }\n    __typename\n  }\n}\n",
        variables: { address: "0xc31e54c7a869b9fcbecc14363cf510d1c41fa443", skip: 0 }
      }

      fetch(
        UNISWAP_SUBGRAPH_ENDPOINT,
        { method: "POST", body: JSON.stringify(bodyUniswap) }
      ).then((res) => {
        res.json().then((data) => {
          const poolDayDatas = data.data.poolDayDatas

          const iv = Math.sqrt(Number(poolDayDatas[0].feesUSD) * 365 / Number(poolDayDatas[0].tvlUSD))

          updateText('uni-tvl', '$' + convertNotionalToString(Number(poolDayDatas[0].tvlUSD)))
          updateText('uni-vol', '$' + convertNotionalToString(Number(poolDayDatas[0].volumeUSD)))
          updateText('uni-fee', '$' + convertNotionalToString(Number(poolDayDatas[0].feesUSD)))
          updateText('uni-iv', (iv * 100).toFixed(1) + '%')

        })
      })

      fetch(
        DEFILLAMA_ENDPOINT,
        { method: "GET" }
      ).then((res) => {
        res.json().then((data) => {
          console.log(data)
          updateText('predy-tvl', '$' + convertNotionalToString(Number(data)))
        })
      })

      await loadLendingPool()
    }

    function convertNotionalToString(value) {
      if (value > 1000000) {
        return (value / 1000000).toFixed(2) + 'm'
      } else if (value > 1000) {
        return (value / 1000).toFixed(2) + 'k'
      } else {
        return value.toFixed(2)
      }
    }

    async function loadLendingPool() {
      const asset1 = await contract.getAsset(1)
      const asset2 = await contract.getAsset(2)

      const totalCompoundDeposited = asset1[4][0]
      const totalNormalDeposited = asset1[4][2]
      const totalNormalBorrowed = asset1[4][3]
      const assetScaler = asset1[4][4]

      const totalCompoundDeposited2 = asset2[4][0]
      const totalNormalDeposited2 = asset2[4][2]
      const totalNormalBorrowed2 = asset2[4][3]
      const assetScaler2 = asset2[4][4]

      const supply1 = (totalCompoundDeposited * assetScaler / (10n ** 18n) + totalNormalDeposited) / (10n ** 6n)
      const supply2 = (totalCompoundDeposited2 * assetScaler2 / (10n ** 18n) + totalNormalDeposited2) / (10n ** 16n)
      const borrow1 = totalNormalBorrowed / (10n ** 6n)
      const borrow2 = totalNormalBorrowed2 / (10n ** 16n)

      const ur1 = borrow1 * (10n ** 18n) / supply1
      const ur2 = borrow2 * (10n ** 18n) / supply2

      const irm1 = asset1[7]
      const irm2 = asset2[7]

      updateText('usdc-supply-text', convertNotionalToString(Number(supply1)))
      updateText('eth-supply-text', Number(supply2) / 100)

      updateText('usdc-apr-text', (Number(calculateSupplyAPR(irm1, ur1) / (10n ** 14n)) / 100).toFixed(2) + '%')
      updateText('eth-apr-text', (Number(calculateSupplyAPR(irm2, ur2) / (10n ** 14n)) / 100).toFixed(2) + '%')

      updateText('usdc-ur-text', Number(ur1 / (10n ** 16n)).toFixed(1) + '%')
      updateText('eth-ur-text', Number(ur2 / (10n ** 16n)).toFixed(1) + '%')
    }

    function updateText(id, value) {
      const usdcSupplyTextElem = document.getElementById(id)
      usdcSupplyTextElem.innerHTML = value.toString()
    }

    function calculateSupplyAPR(params, ur) {
      return calculateInterestRate(params, ur) * ur / (10n ** 18n)
    }

    function calculateInterestRate(params, ur) {
      const ONE = (10n ** 18n)

      if (ur < 0) {
        throw new Error('utilization ratio must be positive value.')
      }

      let ir = params[0]

      if (ur <= params[1]) {
        ir = ir + (ur * params[2]) / ONE
      } else {
        ir = ir + (params[1] * (params[2]) / ONE)
        ir = ir + (params[3] * (ur - params[1]) / ONE)
      }

      return ir
    }

    // When the user clicks on <div>, open the popup
    function showPopup(no) {
      const popupWrapper = document.getElementById(`popup${no}-wrapper`);
      const popup = document.getElementById(`popup${no}-content`);

      popupWrapper.classList.toggle("show");
      popup.classList.toggle("show");
    }

  <style>
    html {

    .svg__container {
      position: relative;
      width: 100%;
    }

    .svg__content {
      display: block;
      margin: 0 auto;
      max-width: 1360px;
    }

    /* Popup container */
    .popup {
      position: relative;
      display: inline-block;
      cursor: pointer;
    }

    /* The actual popup (appears on top) */
    .popup .popuptext {
      visibility: hidden;
      width: 320px;
      background-color: #fff;
      color: #000;
      font-size: 22px;
      text-align: center;
      border-radius: 6px;
      padding: 8px 0;
      position: absolute;
      z-index: 1;
      margin-left: 0px;
      box-shadow: 0 10px 25px 0 rgba(0, 0, 0, 0.5);
    }

    /* Popup arrow */
    .popup .popuptext::after {
      content: "";
      position: absolute;
      top: 100%;
      left: 50%;
      margin-left: -5px;
      border-width: 5px;
      border-style: solid;
      border-color: #fff transparent transparent transparent;
    }

    /* Toggle this class when clicking on the popup container (hide and show the popup) */
    .popup .show {
      visibility: visible;
      -webkit-animation: fadeIn 700ms;
      animation: fadeIn 700ms
    }

    .popup .popup-wrapper {
      visibility: hidden;
    }

    .popup-wrapper .show {
      visibility: visible;
    }

    /* Add animation (fade in the popup) */
    @-webkit-keyframes fadeIn {
      from {
        opacity: 0;
      }

      to {
        opacity: 1;
      }
    }

    @keyframes fadeIn {
      from {
        opacity: 0;
      }

      to {
        opacity: 1;
      }
    }
  </style>
